import React from "react";
import ResultsList from "./ResultsList";
import { View } from "react-native";
//import { restaurantList } from "./src/screens/restaurantList";

const ResultsListContainer = ({ restaurantList }) => {
  return (
    <View>
      <ResultsList
        locationName={restaurantList[0].restaurantName}
        distance={restaurantList[0].distance}
      />
      <ResultsList
        locationName={restaurantList[1].restaurantName}
        distance={restaurantList[1].distance}
      />
      <ResultsList
        locationName={restaurantList[0].restaurantName}
        distance={restaurantList[0].distance}
      />
      <ResultsList
        locationName={restaurantList[1].restaurantName}
        distance={restaurantList[1].distance}
      />
    </View>
  );
};

export default ResultsListContainer;
